import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Home from './pages/Home';
import Admin from './pages/Admin';
import AdoptionPage from './pages/AdoptionPage';
import AdoptionContact from './pages/AdoptionContact';
import BlogSection from './components/BlogSection';
import BlogArticle from './pages/BlogArticle';
import posts from './data/postsData'; // Twoje wpisy blogowe
import "./styles/variables.css";

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/zwierzak-do-adopcji" element={<AdoptionPage />} />
        <Route path="/adopcja" element={<AdoptionPage />} />
        <Route path="/admin" element={<Admin />} />
        <Route path="/adoption-contact/:animalName" element={<AdoptionContact />} />

        {/* Blog */}
        <Route path="/blog" element={<BlogSection posts={posts} />} />
        <Route path="/blog/:slug" element={<BlogArticle posts={posts} />} />
      </Routes>
    </Router>
  );
}

export default App;
